    ele1.classList.add('itemContent');
    ele1.textContent = input.value;
    ele2.classList.add('deleteBtn');
    ele2.textContent = 'Delete';
    li.classList.add('todoItem')
    document.getElementById('todoList').appendChild(li);
    input.value = '';
  });
});

